import React from 'react';
//import logo from './logo.svg';
import './App.css';
import './Fonts.css';
import Header from "./components/Header/Header";
import Navigation from "./components/Navigation/Navigation";
import Home from "./components/Home/Home";
import Footer from "./components/Footer/Footer";
import About from "./components/About/About";
import Blog from "./components/Blog/Blog";
import Portfolio from "./components/Portfolio/Portfolio";
import Contact from "./components/Contact/Contact";
import {BrowserRouter, Route} from "react-router-dom";



const App = (props) => {
  return (
        <BrowserRouter>
            <div className="App">
                <header>
                    <Header/>
                </header>
                <div className='nav'>
                    <Navigation />
                </div>
                <div className='content'>
                    <Route exact path='/'
                           render={ () => <Home
                               arrHead={props.appState.homePage.arrHead}
                               homeBlock2={props.appState.homePage.homeBlock2}
                               homeBlock3={props.appState.homePage.homeBlock3}
                               homeBlock4={props.appState.homePage.homeBlock4}
                               homeBlock5={props.appState.homePage.homeBlock5}/>}/>
                    <Route path='/about'
                           render={ () => <About
                               homeBlock5={props.appState.homePage.homeBlock5} />} />
                    <Route path='/portfolio' component={Portfolio} />
                    <Route path='/blog' component={Blog} />
                    <Route path='/contact' component={Contact} />
                </div>
                <div className='footer'>
                    <Footer />
                </div>
            </div>
        </BrowserRouter>
  );
};

export default App;
